/////////////
var arr=[],i;
var image=document.querySelector("#image");
var buttons=document.querySelectorAll(".btn");
var p=document.getElementById("Score");
var highScore=document.getElementById("High Score");
var reset=document.querySelector("#reset");
var score=0,maxScore=0;

////////////

init();
function init(){
  setQuestion();
  listener();
}

////////////

function createOptions(){
  var arr = [];
  while(arr.length < 5){
      var r = Math.floor(Math.random() * data.length);
      if(arr.indexOf(r) === -1) arr.push(r);
  }
  return arr;
}


/////////////

function setQuestion(){
  arr=createOptions();
  i=Math.floor(Math.random()*4);
  render();
}

/////////////

function render(){
  image.src=data[arr[i]].img;
  for(let x=0;x<4;x++){
    buttons[x].innerText=data[arr[x]].word;
    buttons[x].style.backgroundColor="blue";
  }
  p.innerText="Current Score: "+score;
  highScore.innerText="High score: "+maxScore;
}

/////////////

function listener() {
  for(let x=0;x<4;x++){
    buttons[x].addEventListener("click",function(){
      if(buttons[x].innerText===data[arr[i]].word.toUpperCase()){
        buttons[x].style.backgroundColor="green";
        score++;
        if(score>maxScore)maxScore=score;
        setTimeout(function(){setQuestion()}, 500);
      }
      else{
        buttons[x].style.backgroundColor="red";
        score=0;
        setTimeout(function(){setQuestion()}, 500);
      }
    })
  }
}

/////////////

reset.addEventListener("click",function(){
  score=0;maxScore=0;
  setQuestion();
});